import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import ArtistCard from "./Components/artist-card.js";
function App() {
  return (
    <div className="container">
      <div className="row">
        <ArtistCard
          img="https://i.pinimg.com/originals/a7/33/fc/a733fccb30d5b24dbea334fe6e2d5d08.jpg"
          titulo="Gustavo Cerati"
        />
        <ArtistCard
          img="https://i.pinimg.com/originals/a3/a8/e3/a3a8e3923d364d12b277542cdaa7bce3.jpg"
          titulo="Tame Impala"
        />
        <ArtistCard />
        <ArtistCard />
        <ArtistCard />
        <ArtistCard />
      </div>
    </div>
  );
}

export default App;
